def check_if_inside(a, A):
    """
    Checks whether a is inside A
    """
    #to visualize:
    """
    (x3, y3)
    _________________________
    |                       |
    |  (x1, y1)             |
    |    _________          |
    |   |         |         |
    |   |         |         |
    |   |_________|         |
    |            (x2, y2)   |
    |_______________________|
    |                        (x4, y4)
    
    """
    
    
    x1 = a["X"]
    y1 = a["Y"]
    x2 = a["X"] + a["W"]
    y2 = a["Y"] + a["H"]

    x3, x4 = A["X"]
    y3, y4 = A["Y"]

    # if x1 is between x3 and x4 and y1 is between y3 and y4
    # and
    # if x2 is between x3 and x4 and y2 is between y3 and y4
    # then return True
    if (x1 >= x3 and x1 <= x4) and (y1 >= y3 and y1 <= y4) and (x2 >= x3 and x2 <= x4) and (y2 >= y3 and y2 <= y4):
        return True 
    return False

