def get_words(coordinates, text_json):
    words = []
    for key1, frame_data in text_json.items():
        if "predicted_text" in frame_data: 
            text_data1 = frame_data["predicted_text"]
            if "fullTextAnnotation" in text_data1: 
                text_data2 = text_data1["fullTextAnnotation"]
                for boundingboxes in text_data2:
                    if "text" in boundingboxes: 
                        if check_if_inside(boundingboxes["boundingBox"], coordinates):
                            final_text = boundingboxes["text"]
                            words.append(final_text)
    return words
                        
